import { useSelector, useDispatch } from "react-redux";
import { clearUserInfo } from "../redux/authSlice"; 
import { showModal } from "../redux/modalStackSlice";
import { logout } from "../api/auth";

export default function Header()
{
    const { nickname } = useSelector((state) => state.auth);
    const dispatch = useDispatch();

    function handleLogout()
    {
        logout();
        dispatch(clearUserInfo());
    }

    return(
        <header className="bg-gradient-to-b from-gray-100 to-indigo-700 shadow-lg p-6 border-b border-indigo-600 rounded-xl">
  <div className="flex justify-between items-center w-full">
    <div className="text-2xl font-extrabold text-indigo-900 select-none">DummyBoard</div>
    {nickname ? (
      <div className="flex items-center space-x-4">
        <h1 className="font-semibold text-indigo-100">{nickname}</h1>
        <button
          onClick={handleLogout}
          className="bg-indigo-500 text-white px-5 py-2 rounded-lg hover:bg-indigo-600 transition"
        >
          로그아웃
        </button>
      </div>
    ) : (
      <button
        onClick={() => {
          dispatch(showModal("login"));
        }}
        className="bg-indigo-600 text-white px-5 py-2 rounded-lg hover:bg-indigo-700 transition"
      >
        로그인
      </button>
    )}
  </div>
</header>
    );
}
